import React, { useState } from "react";
import useFetch from "../../util/useFetch";


function Todocount () {
    const [todo] = useFetch('http://localhost:3000/lists/').length
    const [count, setcount] = useState(todo)
    return (
        <div>
            <div>
                오늘 해야할 일 : {count}개
            </div>
            <div>
                오늘 한 일 : {count}개
            </div>
        </div>
    )
}

export default Todocount
